import React from 'react';
import './header.css';

function Header() {
  return (
    <header>
      <div className="logoDiv">
        <img className="logoHeader" src='./imagenes/logo.png' alt="Logo" />
      </div>
      <div className="input-group mb-3">
        <input type="text" className="form-control" aria-label="Recipient's username" aria-describedby="button-addon2" />
        <button className="btn btn-outline-secondary" type="button">Buscar</button>
      </div>
      <div className="login">
        <a className="dropbtn">Iniciar sesi√≥n / Registrarse</a>
        <div className="login-content">
          <button>Inicio</button>
          <button>Registrarse</button>
        </div>
      </div>
    </header>
  );
}

export default Header;
